import React, { useEffect, useState } from "react";
import axios from "../utils/axiosInstance";

const HistoryList = () => {
  const [history, setHistory] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchHistory = async () => {
      try {
        const res = await axios.get("/gdpr/history");
        setHistory(res.data);
      } catch (err) {
        console.error("Kunne ikke hente historik", err);
      } finally {
        setLoading(false);
      }
    };
    fetchHistory();
  }, []);

  if (loading) return <p>IndlÃ¦ser historik...</p>;

  if (history.length === 0) {
    return <p>Ingen tidligere analyser fundet.</p>;
  }

  return (
    <div style={{ marginTop: "2rem" }}>
      <h3>ðŸ•“ Tidligere analyser</h3>
      <table style={{ width: "100%", borderCollapse: "collapse", marginTop: "1rem" }}>
        <thead>
          <tr style={{ backgroundColor: "#f1f1f1" }}>
            <th style={thStyle}>URL</th>
            <th style={thStyle}>Score</th>
            <th style={thStyle}>Dato</th>
          </tr>
        </thead>
        <tbody>
          {history.map((item) => (
            <tr key={item.id} style={{ borderBottom: "1px solid #ddd" }}>
              <td style={tdStyle}>{item.url}</td>
              <td style={tdStyle}>{item.score}%</td>
              <td style={tdStyle}>{new Date(item.created_at).toLocaleString("da-DK")}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

const thStyle = {
  textAlign: "left",
  padding: "12px",
  borderBottom: "2px solid #ccc"
};

const tdStyle = {
  padding: "12px"
};

export default HistoryList;
